import React from 'react';
import './SolutionPage.css';

export default function AfterHoursAnsweringService() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">After Hours Answering Service</h1>
      <p className="solution-desc">Rosie answers your calls even after your business closes, capturing every lead and providing information to your customers at any hour.</p>
      <div className="solution-section">
        <h2>Stay Connected After Hours</h2>
        <ul>
          <li>Capture leads 24/7</li>
          <li>Provide info to late-night callers</li>
          <li>Never miss an important message</li>
        </ul>
      </div>
    </div>
  );
}
